        display: flex;
        align-items: center;
        gap: 0.5rem;
  
        .arrow {
          width: 32px;
          height: 32px;
          border-radius: 50%;
          border: 1px solid #ccc;
          background: white;
          font-size: 1rem;
          cursor: pointer;
        }
  
        .view-all {
        color:#0A0A0A;
          background: #f5f5f5;
          border: none;
          padding: 0.4rem 1rem;
          border-radius: 20px;
          font-weight: 500;
          cursor: pointer;
        }
      }
    }
  
    .cards {
      display: flex;

      .card {
    
        border-radius: 14px;
        overflow: hidden;
        width: 300px;
        display: flex;
       
  
        .image {
          position: relative;
  
          img {
            width: 384px;
        height: 288px;
        flex-shrink: 0;
          }
  
          .tag {
            position: absolute;
            top: 10px;
            left: 10px;
            background: white;
            font-size: 0.75rem;
            padding: 0.2rem 0.6rem;
            border-radius: 8px;
            font-weight: 500;
          }
        }
  
