                background: #9c6eff;
              }
              &.orange {
                background: #f97316;
              }
              &.violet {
                background: #7c3aed;
              }
            }
          }
  
          h3 {
            font-size: 1rem;
            font-weight: 700;
            margin-bottom: 0.4rem;
          }
  
          p {
            font-size: 0.9rem;
            color: #555;
            line-height: 1.4;
            margin-bottom: 0.8rem;
          }
  
          .link {
            color: #6c63ff;
